import React, {Component} from 'react';
import honoluluImage from '../images/honolulu.jpeg';
import { Button, Alert, Breadcrumb, Card, Image, Container } from 'react-bootstrap';
import Carousel from 'react-bootstrap/Carousel';

class Landing extends React.Component {
    render() {
        return (
            <div>
                <Carousel>
                <Carousel.Item>
                <Image src={honoluluImage} alt="Honolulu" fluid /> 
                    <Carousel.Caption>
                    <h3>First slide label</h3>
                    <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
                    </Carousel.Caption>
                </Carousel.Item>
                <Carousel.Item>
                <Image src={honoluluImage} alt="Honolulu" fluid style={{ width: '800%', height: 'auto' }}/> 
                    <Carousel.Caption>
                    <h3>Second slide label</h3>
                    <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
                    </Carousel.Caption>
                </Carousel.Item>
                <Carousel.Item>
                <Image src={honoluluImage} alt="Honolulu" fluid style={{ width: '100%', height: 'auto' }}/> 
                    <Carousel.Caption>
                    <h3>Third slide label</h3>
                    <p>
                        Praesent commodo cursus magna, vel scelerisque nisl consectetur.
                    </p>
                    </Carousel.Caption>
                </Carousel.Item>
                </Carousel>
            </div>
        );
    }
}


export default Landing;
